    xid_rubro int,
    xid_subrubro int,
    xpagina int
)
BEGIN
    SELECT
        art.id,
        art.descripcion,
        art.codigo,
        pre.precio_lista,
        art.existencia_stock,
        art.alicuota_iva
    FROM
        articulos art
