  FROM articulos
  WHERE codigo = ItemCode;
  SELECT
    id INTO @vIdPriceList
  FROM listas_precios
  WHERE price_list = PriceList;

  SELECT
    COUNT(*) INTO vCantReg
  FROM articulos_precios
  WHERE id_articulo = vIdArticulo;
  IF vCantReg = 0 THEN
      VALUES (@vIdPriceList, vIdArticulo, Price, 0);
  ELSE
    SELECT
      COUNT(*) INTO vCantRegPrecios
    FROM articulos_precios
    WHERE id_articulo = vIdArticulo
    AND id_listaprecio = @vIdPriceList;
    IF vCantRegPrecios = 0 THEN
        VALUES (@vIdPriceList, vIdArticulo, Price, 0);
    ELSEIF vCantRegPrecios = 1 THEN
      SELECT
        precio_lista INTO @vPrecioAnterior
      FROM articulos_precios
      WHERE id_articulo = vIdArticulo
      AND id_listaprecio = @vIdPriceList;
      IF @vPrecioAnterior != Price THEN
        UPDATE articulos_precios
        SET precio_anterior = @vPrecioAnterior,
            precio_lista = Price
        WHERE id_articulo = vIdArticulo
        AND id_listaprecio = @vIdPriceList;
      END IF;
    END IF;
 END IF;

END ;;
